# In[13]:


def step(state, action):
  ###### Your code here ######
    next_state = (state + action).tolist()
    x, y = next_state
    if x < 0 or x >= 4 or y < 0 or y >= 4:
        next_state = state
    
    x, y = next_state
    if (x == 0 and y == 1) or (x == 1 and y == 3) or (x == 2 and y == 0) or (x == 3 and y == 2):
        reward = -100
    else:
        reward = -1

    return [next_state, reward]
  ################################
  


